import authApi from "./api/authApi";
import {useState} from "react";

export default function Login() {

  const [username, setUsername] = useState('')
  const [password, setPassword] = useState('')

  async function loginHandler() {
    ev.preventDefault()
    const resopnse = await authApi.login(username, password);
  }

    return (
        <form class="col s12" method="post" id="signupForm" onSubmit={loginHandler}>
          <div class="row">
            <div class="input-field col s7 ">
              <i class="material-icons prefix">account_circle</i>
              <input type="text" placeholder="userId"
                     class="validate" name="username" onChange={ e => setUsername(e.target.value)}/>
            </div>
          </div>
          <div class="row">
            <div class="input-field col s7 ">
              <i class="material-icons prefix">account_circle</i>
              <input type="password" onChange={ e => setPassword(e.target.value)}
                     placeholder="password" class="validate" name="password"/>
              <span  class="helper-text"></span>
            </div>
          </div>
          <div class="row">
            <button class="btn waves-effect waves-light offset-s1 col-6" type="submit"
                    name="action">
              Submit
              <i class="material-icons right">send</i>
            </button>
          </div>
        </form>
    )
}
